import HeaderCartButton from "./HeaderCartButton";

const Header = (props) => {
  return (
    <div className={classes.header}>
      <h2>ReactMeals</h2>
      <HeaderCartButton className={classes.mainImage}></HeaderCartButton>
    </div>
  );
};

export default Header;
